          ValueId: null,
          LocalizedValues: null,
          Value:
            "Poin-poin fitur utama:\n- Layar Liquid Retina 10,9 inci yang memukau1 dengan True Tone\n- Chip A14 Bionic dengan CPU 6-core dan GPU 4-core\n- Kamera belakang Wide 12 MP\n- Kamera depan Ultra Wide 12 MP lanskap dengan Center Stage\n- Touch ID untuk autentikasi aman\n- Tetap terhubung dengan Wi-Fi 6 ultra cepat dan LTE2\n- Konektor USB-C untuk pengisian daya dan aksesoris\n- Selangkah lebih maju dengan kekuatan baterai sepanjang hari3\n- Berfungsi dengan Apple Pencil (generasi ke-1)4 dan Magic Keyboard Folio\n- iPadOS 16 menjadikan iPad semakin andal dengan fitur produktivitas dan kolaborasi baru yang luar biasa\n\nSpesifikasi:\nBrand : Apple\nWarna : Silver\nKapasitas : 64 GB\nKonektivitas : Wi-Fi + Cellular\nUkuran Layar : 10.9 inci\nTipe Layar : \n- Layar Multi-Touch berlampu latar LED 10,9 inci (diagonal) dengan teknologi IPS\n- Resolusi 2360 x 1640 piksel dengan 264 piksel per inci (ppi)\n- Layar True Tone\n- Kecerahan 500 nit\n- Lapisan oleophobic anti sidik jari\n- Mendukung Apple Pencil (generasi ke-1)\nUkuran dan Berat : \n- Tinggi 250,6 mm\n- Lebar 179,5 mm\n- Tebal 7 mm\n- Berat 481 gram\nChip:\n- Chip Apple A14\n- CPU 6-core\n- GPU 4-core\n- Neural Engine\nKamera :\n- Kamera Wide 12 MP, bukaan ƒ/1.8\n- Zoom digital hingga 5x\n- Lensa lima elemen\n- Fokus otomatis dengan Focus Pixels\n- Panorama (hingga 63 MP)\n- Smart HDR 3\n- Penanda lokasi foto\n- Penstabilan gambar otomatis\n- Mode beruntun\n- Format gambar yang diambil: HEIF dan JPEG\nPerekaman Video :\n- Perekaman video 4K pada kecepatan 24 fps, 25 fps, 30 fps, atau 60 fps\n- Perekaman video HD 1080p pada kecepatan 25 fps, 30 fps, atau 60 fps\n- Perekaman video HD 720p pada kecepatan 30 fps atau 60 fps\n- Dukungan video slo-mo untuk 1080p pada kecepatan 120 fps atau 240 fps\n- Video selang waktu dengan penstabilan\n- Rentang dinamis yang diperluas untuk video hingga kecepatan 30 fps\n- Penstabilan gambar video\n- Penstabilan video sinematik (1080p dan 720p)\n- Video fokus otomatis kontinu\n- Zoom pemutaran\n- Format video yang diambil: HEVC dan H.264\nKamera Depan:\n- Kamera Ultra Wide 12 MP lanskap, bidang pandang 122°\n- Bukaan ƒ/2.4\n- Smart HDR 3\n- Perekaman video HD 1080p pada kecepatan 25 fps, 30 fps, atau 60 fps\n- Video selang waktu dengan penstabilan\n- Rentang dinamis yang diperluas untuk video hingga kecepatan 30 fps\n- Penstabilan video sinematik (1080p dan 720p)\n- Koreksi lensa\n- Retina Flash\n- Penstabilan gambar otomatis\n- Mode beruntun\nKompatibel : Apple Pencil (generasi ke-1)\nAudio : Speaker stereo lanskap\nDaya dan Baterai : \n- Baterai lithium-polymer bawaan yang dapat diisi ulang 28,6 watt-jam\n- Hingga 10 jam untuk menjelajahi web melalui Wi-Fi atau menonton video\n- Pengisian daya melalui adaptor daya atau USB-C ke sistem komputer\n- Hingga 9 jam untuk menjelajahi web menggunakan jaringan data seluler\nAutentikasi Aman :  Touch ID\nSeluler dan Nirkabel :\n- Wi-Fi (802.11ax); band ganda simultan(2,4 GHz dan 5 GHz); HT80 dengan MIMO\n- Teknologi Bluetooth 5.2\n- 5G NR (Band n1, n2, n3, n5, n7, n8, n12, n20, n25, n28, n29, n30, n38, n40, n41, n48, n66, n71, n77, n78, n79)4\n- FDD-LTE (Band 1, 2, 3, 4, 5, 7, 8, 11, 12, 13, 14, 17, 18, 19, 20, 21, 25, 26, 28, 29, 30, 32, 66, 71)\n- TD-LTE (Band 34, 38, 39, 40, 41, 42, 46, 48)\n- UMTS/HSPA/HSPA+/DC-HSDPA (850, 900, 1700/2100, 1900, 2100 MHz)\n- Data saja\n- eSIM\nSensor:\n- Touch ID\n- Gyro tiga sumbu\n- Akselerometer\n- Barometer\n- Sensor cahaya sekitar\nKartu SIM :Nano-SIM (mendukung Apple SIM), eSIM\nKonektor : USB-C, Smart Connector",
